import * as React from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Outlet,
} from "react-router-dom";

import Nav from "./components/Nav";
import Login from "././routes/Login";
import Register from "././routes/Register";
import Buyer from "././routes/Buyer";
import Buyer_Profile from "./routes/Buyer_Profile";
import Buyer_Order from "./routes/Buyer_Order";
import Vendor from "./routes/Vendor";
import Vendor_Profile from "./routes/Vendor_Profile";
import Vendor_Order from "./routes/Vendor_Order";

const Layout = () => {
  return (
    <div>
      <Nav></Nav>
      <div className="container">
        <Outlet />
      </div>
    </div>
  );
};

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Layout></Layout>}>
          <Route path="login" element={<Login></Login>} />
          <Route path="register" element={<Register></Register>} />
          <Route path="buyer/:username" element={<Buyer></Buyer>} />
          <Route path="buyer/profile/:username" element={<Buyer_Profile></Buyer_Profile>} />
          <Route path="buyer/orders/:username" element={<Buyer_Order></Buyer_Order>} />
          <Route path="vendor/:username" element={<Vendor></Vendor>} />
          <Route path="vendor/profile/:username" element={<Vendor_Profile></Vendor_Profile>} />
          <Route path="vendor/orders/:username" element={<Vendor_Order></Vendor_Order>} />
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
